import React from 'react'
import { useContext } from 'react'

function Transport() {
    let [context,setContext] = useContext(UserContext)
    let data = context;
  return (
    <div>
      Transport
      {
        data.map((ele,index)=>{
            <h1>{ele}</h1>
        })
      }
    </div>
  )
}

export default Transport
